import React from 'react'
import './Pricing.css'

const Pricing = () => {
    return (
        <React.Fragment>
            <section className="content-container">



                <ul className="price">
                    <li className="col-header" style={{backgroundColor:'#37387a'}}>Coming Soon</li>

                </ul>




            </section>
        </React.Fragment>
    )
}

export default Pricing;
